const Card = ({name, date}) => {
    const API_URL = `http://aleksanderblaszkiewicz.pl/kiedykolos/get_courses.php`;
    const [courses, setCourses] = useState([]);

    useEffect(() => {
        getCourses();
    }, []);

    const getCourses = async () => {
        const response = await fetch(API_URL);
        const data = await response.json();
        setCourses(data);
        console.log(courses);
    }
    return(
        <>
            <h1>Przedmiot: {name}</h1>
            <p>Data: {date}</p>
        </>
    )
}

export default Card;
